(1, 'Xiaomi Redmi Note 11', 'xiaomi-redmi-note-11', 'Redmi Note 11 โฉมใหม่โดดเด่นด้วยดีไซน์เฟรมแบนราบนำเทรนด์ในสไตล์มินิมอล เพลิดเพลินกับเนื้อหาของคุณในอัตรารีเฟรชอันราบรื่นที่สูงถึง 90Hz เลื่อนดูหน้าฟีดโซเชียลมีเดียของคุณได้ลื่นไหล หรือไปสัมผัสประสบการณ์เล่นเกมสุดแรงและตอบสนองฉับไว ชาร์จเต็ม 100% ในเวลาแค่ประมาณหนึ่งชั่วโมงด้วยระบบชาร์จเร็ว 33W* ของ Redmi Note 11 ที่สนับสนุนโดยเทคโนโลยี MMT ใหม่ของ Redmi Note พบกับประโยชน์จากระบบชาร์จเร็วที่จะมาเปลี่ยนชีวิตคุณ \n\n- Screen Size : 6.43 inch\n- Snapdragon® 680\n- 90Hz AMOLED DotDisplay\n- ระบบชาร์จความเร็วสูง 33W Pro\n- Battery : 5000mAh', '6999.00', 5, 1, '2023-02-11 21:40:32.599000', '2023-02-11 21:40:33.914000', '2023-02-11 21:40:33.911000', 1, 1),
(2, 'Galaxy S23 Ultra (12+512) Phantom Black (5G)', 'galaxy-s23-ultra-12-512-phantom-black-5-g', 'สมาร์ทโฟนที่มาพร้อมกล้องที่ดีสุดใน Galaxy และปากกา S Pen ที่เป็นมากกว่าปากกา มาพร้อม Space Zoom ซูมไกล 100 เท่า ไกลแค่ไหนก็ใกล้ได้  ให้ความคมชัด High-resolution กล้องคุณภาพสูง 200MP เก็บครบทุกรายละเอียด มากกว่าที่ตาคุณเห็น ถ่ายภาพคมชัดที่สุดที่เคยมีมาในสมาร์ทโฟน S Pen ที่เป็นทั้งปากกา และผู้ช่วยส่วนตัว ปากกาเขียนลื่นเหมือนใช้ปากกาจริง ใช้สั่งถ่ายรูป เปลี่ยนสไลด์ แปลภาษา แต่งรูป เล่นเกม และอีกมากมาย\n\n- ขนาดหน้าจอ 6.8 นิ้ว (แนวทะแยง)\n- ความละเอียด 3,088 x 1,440 พิกเซล (500ppi)\n- แบตเตอรี่ 5,000 mAh\n- กล้องหน้า 12 MP (f/2.2) 2PD AF\n- กล้องหลัง 200 MP (f/1.7) Wide', '49900.00', 10, 1, '2023-02-11 21:41:47.431000', '2023-02-11 21:41:48.619000', '2023-02-11 21:41:48.616000', 1, 1),
(3, 'เสื้อโปโล Dry ผ้าปิเก้ แขนสั้น ลายทาง', 'polo-dry-shirt', 'ผ้าคอตตอนผสมโพลีเอสเตอร์รีไซเคิลให้สัมผัสนุ่มและทนทาน องค์ประกอบหลักของเสื้อรุ่นนี้ยังคงพัฒนาอย่างไม่หยุดยั้ง', '790.00', 2, NULL, '2023-02-11 21:43:31.517000', '2023-02-11 21:43:32.903000', '2023-02-11 21:43:32.898000', 1, 1),
